import React from "react";
import styled from "styled-components";

const HomeWrapper = styled.div`
  position: relative;
  bottom: px;
`;

export const Home: React.FC = () => {
  return (
    // @ts-ignore
    <HomeWrapper>
      <video src="video/mainVideo1.mp4" autoPlay={true} />
    </HomeWrapper>
  );
};
